  input: '"TEXT","F3XA","C00034033","1. The SCGOP is using the following best effort
    to obtain identification of all individuals who contribute in excess of $200.  Our
    original solicitation includes a clear and conspicuous request for this information
    which includes the requirements of the federal law to provide such information.  If
    the information is not provided, we make a follow up effort per phone.  If the
    needed information is still not provided, we search the internet to obtain the
    information.  2. Additional information have been obtained and an amendment has
    been made for the following contributors: Roy Adams, Susan Austin, June Axford,
    Wilford Broome, Alec Brown, Alan Buerger, Constance Buerger, Harry Butler, Brenda
    Compton, Mary cooper, Josephine Darby, Charles Dunlap, Joseph Flowers, W Russell
    Floyd, Charles Hamel, Frampton Henderson, Frank Johnson, Julia Johnson, Marie
    Kleckley, Mickey Lindler, Leon Marsha, William Mottel, Robert Rogers, Greg Ryberg,
    Ramon Schwartz, Nancy Slocum, Cecil Windham.   3. The disbursements on Schedule
    B to Feather, Larson, and Synthorst for $22188.70, to Drea Byars for $ 1000, to
    the Harbor Club for $727.19, to Sign It Quick for $569.94, and to Starboard for
    $16958 were for general fundraising; They did not refer to a clearly identified
    candidate for Federal office, nor did they promote, support, attack, or oppose
    any candidate for Federal office.  4. The disbursement to Cleta Mitchell was actually
    not paid on the split; the $ 4455.57 paid from our federal account was determined
    by Mrs. Mitchell herself according to the allocation of money raised.  5.  We
    have changed the disbursements for health insurance to FEA.  This resulted in
    a refund of allocated funds for joint expenditures of $ 434.82 from our federal
    to our nonfederal account.  This will be accounted for in our August Monthly Report.  We
    will also mail prove of the transaction to you, as discussed on the phone. 6.
    Our janitor, Barry Rhue, is a subcontractor, not an employee."'
